    false,nt"url": null,nt"notes": "The SEFSC, in cooperation with the South
    Atlantic states, collects South Atlantic shrimp data from dealers and fishermen.
    These data are collected to provide catch, value, area caught, and effort data for
    individual commercial fishing trips. It should be noted that some states are not
    providing effort data. Although this objective is never totally achieved, the SEFSCs
    data do provide a near-census of the commercial catches, the majority of which are
